start/distributed.html.body:
Distribution
 allows to seamlessly distribute the graph across computational nodes. 
Therefore, let's first setup a server node, which exposes the many-world graph to clients via websocket. 
Graph g = new GraphBuilder()
    .withMemorySize(10000) //cache size before sync to disk
    .withStorage(new LevelDBStorage("_db"))
    .build();

 g.connect(isConnected -> {
    new WSServer(g, 8050).start();
        System.out.println(" Server listener :8050");
    });

This code starts a websocket server on localhost port 8050. Next, we connect a client to the websocket server. 
Graph g = new GraphBuilder()
    .withMemorySize(10000) //cache size before sync to disk
    .withStorage(new WSClient("ws://127.0.0.1:8050"))
    .build();

g.connect(isConnected -> {
    //create new node for world 0 and time 0
    Node sensor = g.newNode(0, System.currentTimeMillis()); 
    sensor.set("id", Math.abs(rand.nextInt()));
    sensor.set("value", rand.nextInt());

    g.index("sensors", sensor, "id", res -> {
        g.save(saveResult -> {
            g.findAll(0, System.currentTimeMillis(), "sensors", 
                allSensorsNow -> {
                System.out.println("All sensors indexed:");
                for (Node sensorNow : allSensorsNow) {
                    System.out.println("\t" + sensorNow.toString());
                }
                g.disconnect(result -> System.out.println("GoodBye!"));
            });
        });
    });
});

This allows clients to use the graph hosted on the server. The above code creates a new sensor graph node, a new index, and saves these changes to the server.

tasks/actions/loop.html.body:
Task Action: Loop
The loop action allows to express the repetition of a sub Task passed as a parameter. Similarly to for loop construction in many imperative language, this action express the iteration over a range, through INCLUSIVE boundaries. 

Additionally the loop action declares automatically a i variable containing the current loop index.

Therefore the following expression: 
loop("0", "3",
    newNode()
    .setProperty("name", Type.STRING, "node_{{i}}")
    .print("{{result}}")
)
.execute(g,null);

Will print the following output in console:
{"world":0,"time":0,"id":1,"name":"node_0"}
{"world":0,"time":0,"id":2,"name":"node_1"}
{"world":0,"time":0,"id":3,"name":"node_2"}
{"world":0,"time":0,"id":4,"name":"node_3"}
In addition, loop action parameters are templates and can express math expression such as "{{=3-1}}" therefore, exclusive bounds can be build this way.
Finally, the loop action is transient and will not modify the current context. Therefore, the task context after the loop action remains unchanged. If a cumulative result has to be built, the best is to use a addToVariable action within the repeated sub task.

tasks/Execute.html.body:
Task execution methods
A task is a prototype of execution that can be defined statically and independently to any graph instances.
A task is executed ON a graph.
The simplest API to do so is the following:
task.execute(graph, null);

If the task aims at returning a result, then the last task context result will be returned in a result callback passed as parameter.
This callback should be of the type of Callback.
Such as:
task.execute(graph, (result)-> {
    //DO something
    if(result != null){
        //you are responsible to free the result set!
        result.free();
    }
});


WARNING: if the callback is not null, you are responsible to free the result, cache full error will occurs otherwise.

